package com.treeze.data;public class Course {		private Long lectureId;	private String lectureName;	private String studentEmail;	public Long getLectureId() {		return lectureId;	}	public void setLectureId(Long lectureId) {		this.lectureId = lectureId;	}	public String getLectureName() {		return lectureName;	}	public void setLectureName(String lectureName) {		this.lectureName = lectureName;	}	public String getStudentEmail() {		return studentEmail;	}	public void setStudentEmail(String studentEmail) {		this.studentEmail = studentEmail;	}}